import React from "react";
import MathComfort from "../assets/mathcomfort.png";

const Page3 = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        marginTop: "50px", // Adjust margin top as needed
      }}
    >
      <div style={{ width: "100%", textAlign: "center" }}>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <img
            src={MathComfort}
            alt="Math Comfort"
            style={{ width: "80%", maxWidth: "390px", marginBottom: "20px" }} // Adjust image size and margin
          />
          <div style={{ textAlign: "left", width: "80%", maxWidth: "390px" }}>
            <h1
              style={{
                marginBottom: "10px",
                fontFamily: "Roboto",
                fontSize: "25px", // Corrected the syntax
                fontWeight: "bold",
              }}
            >
              You're in the right place
            </h1>
            <p>
              Brilliant gets you hands-on to help improve your professional
              skills and knowledge. You'll interact with concepts and solve fun
              problem in math, science, and computer science.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Page3;
